INSERT INTO `commodity` VALUES ('28', '2', 'http://47.100.137.45/images/SneakersMarket/commodity/airjordan/ 554724-069/ 554724-0691.jpg', 'AirJordan1MidAJ1小芝加哥黑红脚趾', 'http://47.100.137.45/images/SneakersMarket/commodity/airjordan/ 554724-069/QWlySm9yZGFuMU1pZEFKMeWwj-iKneWKoOWTpem7kee6ouiEmui2vg((2.jpg;http://47.100.137.45/images/SneakersMarket/commodity/airjordan/ 554724-069/QWlySm9yZGFuMU1pZEFKMeWwj-iKneWKoOWTpem7kee6ouiEmui2vg((3.jpg;http://47.100.137.45/images/SneakersMarket/commodity/airjordan/ 554724-069/QWlySm9yZGFuMU1pZEFKMeWwj-iKneWKoOWTpem7kee6ouiEmui2vg((4.jpg;http://47.100.137.45/images/SneakersMarket/commodity/airjordan/ 554724-069/QWlySm9yZGFuMU1pZEFKMeWwj-iKneWKoOWTpem7kee6ouiEmui2vg((5.jpg;http://47.100.137.45/images/SneakersMarket/commodity/airjordan/ 554724-069/QWlySm9yZGFuMU1pZEFKMeWwj-iKneWKoOWTpem7kee6ouiEmui2vg((6.jpg', '空中飞人 (Air Jordan) 是耐克旗下以史上最著名的NBA球星迈克尔·乔丹(Michael Jordan）命名的系列。1986年，迈克尔·乔丹（Michael Jordan）以高薪合约被当时还是小厂家的体育用品生产 AIR JORDAN商耐克(Nike) 签约至旗下，耐克 (Nike) 更随即为乔丹推出了第一款以乔丹命名的球鞋，即空中飞人 (Air Jordan) 系列的第一款。虽然这款球鞋在当时并不具备奇特的配色以及新奇的科技，但是谁都不曾想到，这居然会是一个神话的开始。', '1200', ' 554724-069', '1299', '0', 'N');
