DROP TABLE IF EXISTS `commodity`;
CREATE TABLE `commodity` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '商品id',
  `sort_id` int(11) NOT NULL COMMENT '商品类型编号',
  `main_image` varchar(500) DEFAULT NULL COMMENT '商品主图',
  `name` varchar(100) DEFAULT NULL COMMENT '商品名称',
  `sub_images` text COMMENT '商品图片',
  `detail` text COMMENT '商品简介',
  `min_price` int(10) DEFAULT NULL COMMENT '最低价',
  `type` varchar(30) DEFAULT NULL COMMENT '货号',
  `send_price` int(10) NOT NULL COMMENT '发售价格',
  `sell_num` int(10) DEFAULT NULL COMMENT '已经销售数量',
  `is_delete` varchar(5) NOT NULL DEFAULT 'N' COMMENT '是否删除',
  PRIMARY KEY (`id`),
  KEY `总类` (`sort_id`),
  CONSTRAINT `总类` FOREIGN KEY (`sort_id`) REFERENCES `commodity_sort` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=191 DEFAULT CHARSET=utf8;

