-- Table structure for `commodity_record`
-- ----------------------------
DROP TABLE IF EXISTS `commodity_record`;
CREATE TABLE `commodity_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '商品交易记录id',
  `uid` int(11) NOT NULL COMMENT '出售人id',
  `bid` int(11) NOT NULL COMMENT '购买者id',
  `price` int(11) NOT NULL COMMENT '价格',
  `buy_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '购买时间',
  `order_num` varchar(50) NOT NULL COMMENT '订单编号',
  `storage_id` int(11) NOT NULL COMMENT '预售表上的id',
  `commodity_id` int(11) NOT NULL COMMENT '商品id',
  `size` float(5,1) NOT NULL COMMENT '尺码',
  `trading_price` int(5) NOT NULL COMMENT '成交价',
  `address_id` int(11) NOT NULL COMMENT '对应收货地址的id',
  `state` int(11) NOT NULL DEFAULT '0' COMMENT '交易状态 0代发货1已发货2交易成功3交易取消',
  `pay` int(11) NOT NULL COMMENT '支付方式1 支付宝2微信，3银行卡',
  `courier_number` varchar(50) DEFAULT NULL COMMENT '快递号',
  `is_delete` varchar(2) NOT NULL DEFAULT 'N' COMMENT '是否删除 N为未删除Y为删除',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`),
  KEY `bid` (`bid`),
  KEY `address_id` (`address_id`),
  KEY `commodity_id` (`commodity_id`),
  CONSTRAINT `commodity_record_ibfk_1` FOREIGN KEY (`uid`) REFERENCES `user` (`id`),
  CONSTRAINT `commodity_record_ibfk_2` FOREIGN KEY (`bid`) REFERENCES `user` (`id`),
  CONSTRAINT `commodity_record_ibfk_3` FOREIGN KEY (`address_id`) REFERENCES `user_address` (`id`),
  CONSTRAINT `commodity_record_ibfk_4` FOREIGN KEY (`commodity_id`) REFERENCES `commodity` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=utf8;

